export default function SinglePost() {
  return (
    <div className='singlePost'>
        <div className="singlePostWrapper">
            <img src="https://media.istockphoto.com/id/1283852667/photo/touch-of-fresh-moss-in-the-forest.jpg?b=1&s=612x612&w=0&k=20&c=S-JC0LTYfw-lIgO-O1RvUIq3DXKUzsGNG8qumxFJ1JU=" alt="" className="singlePostImg" />
        </div>
    </div>
  )
}
